import React, { useRef } from "react";
import SocialLinksComponent from "./components/SocialLinks/SocialLinksComponent";


function SocialMedia(){
    const Links = useRef();

    
    return(
        <>
        <h1>Social Media Page</h1>
        { <SocialLinksComponent links={Links} /> }
        </>
    );
}

export default SocialMedia;
